var lazyloadEls = document.querySelectorAll('.lazy-el');
window.addEventListener('load', function () {
	setTimeout(function () {
		document.documentElement.classList.add('page-loaded')
		lazyloadEls.forEach(function (el) {
			if (!el.href) {
				elData = el.getAttribute('data-src');
				el.src = elData;
			}
			else {
				el.rel = 'stylesheet';
			}
		})
	}, 200)
})

